Storyline

Sutter Keely lives in the now. It's a good place for him. A high school senior, charming and self-possessed, he's the life of the party, loves his job at a men's clothing store, and has no plans for the future. A budding alcoholic, he's never far from his supersized, whiskey-fortified thirst-master cup. But after being dumped by his girlfriend, Sutter gets drunk and wakes up on a lawn with Aimee Finecky hovering over him. She's different: the &quot;nice girl&quot; who reads science fiction and doesn't have a boyfriend. While Amy has dreams of a future, Sutter lives in the impressive delusion of a spectacular now, yet somehow, they're drawn together.


